import React from 'react'
import profilePic from './Images/profilePic.jpg'
import './CSS/homeStyle.css'

const Home = () => {
    return (
        <div className="container">
            <div>
                <img src={profilePic} alt="" className="profilePic" />
            </div>
        </div>
        
    )
}

export default Home
